import './App.css';
import Home from "./Home/Home";
import Canteen from "./Canteen/Canteen";
import {Route, Routes} from "react-router-dom";
import React from "react";
function App() {
  return (
    <>
        <Home />
        <Routes>
            <Route path="/canteen" element={<Canteen />}></Route>
        </Routes>
    </>
  );
}

export default App;
